package com.eval.easy.isSubsequence;

import lombok.val;
import org.junit.jupiter.api.Test;

import static org.assertj.core.api.AssertionsForInterfaceTypes.assertThat;

class SolutionTest {


    private final Solution solution = new Solution();


    @Test
    void test1() {
        val s = "abc";
        val t = "ahbgdc";

        val isSubsequence = solution.isSubsequence(s, t);
        assertThat(isSubsequence).isTrue();

    }

    @Test
    void test2() {
        val s = "axc";
        val t = "ahbgdc";

        val isSubsequence = solution.isSubsequence(s, t);
        assertThat(isSubsequence).isFalse();

    }

    @Test
    void test3() {
        val s = "ab";
        val t = "baab";

        val isSubsequence = solution.isSubsequence(s, t);
        assertThat(isSubsequence).isTrue();

    }


    @Test
    void test4() {
        val s = "leeeeetcode";
        val t = "";
        val isSubsequence = solution.isSubsequence(s, t);
        assertThat(isSubsequence).isTrue();
    }


}